DROP TABLE IF EXISTS `t_product`;
CREATE TABLE `t_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `createTime` bigint(20) DEFAULT NULL,
  `updateTime` bigint(20) DEFAULT NULL,
  `name` varchar(50) NOT NULL COMMENT '商品名称',
  `subName` varchar(100) DEFAULT '0' COMMENT '副名称',
  `code` char(10) DEFAULT '100' COMMENT '商品编码',
  `product_type_id` bigint(20) NOT NULL COMMENT '商品类型ID',
  `onSaleTime` bigint(20) DEFAULT NULL COMMENT '上架时间',
  `offSaleTime` bigint(20) DEFAULT NULL COMMENT '下架时间',
  `brand_id` bigint(20) DEFAULT NULL,
  `state` tinyint(4) DEFAULT '0' COMMENT '状态',
  `maxPrice` int(11) DEFAULT NULL COMMENT '最高价',
  `minPrice` int(11) DEFAULT NULL COMMENT '最低价',
  `saleCount` int(11) DEFAULT '0' COMMENT '销量',
  `viewCount` int(11) DEFAULT '0' COMMENT '浏览量',
  `commentCount` int(11) DEFAULT '0' COMMENT '评论数',
  `commentScore` int(11) DEFAULT '0' COMMENT '评分',
  `viewProperties` varchar(500) DEFAULT NULL COMMENT '显示属性摘要',
  `goodCommentCount` int(11) DEFAULT NULL,
  `commonCommentCount` int(11) DEFAULT NULL,
  `badCommentCount` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='商品';

